q($,"aZd","azd",()=>A.a([A.pQ("    F\u0131nd\u0131k (Corylus avellana L.) d\xfcnya genelinde geni\u015f pop\xfclariteye sahip bir \xfcr\xfcnd\xfcr. \xc7o\u011funlukla Do\u011fu Karadeniz k\u0131y\u0131lar\u0131nda yeti\u015ftirilen f\u0131nd\u0131k bitkisinin, 15\u2019ten fazla t\xfcr\xfc oldu\u011fu belirtilmektedir (Aktaran: Zaman ve Cerrah, 2011). Son y\u0131llarda, k\xfcresel f\u0131nd\u0131k \xfcretiminin lideri olan T\xfcrkiye\u2019nin yan\u0131 s\u0131ra, tar\u0131m tekniklerinin geli\u015fmesi ve yeni \xe7e\u015fitlerin ortaya \xe7\u0131kmas\u0131yla birlikte bir\xe7ok \xfclkede de f\u0131nd\u0131k \xfcretimi artmaktad\u0131r (Krol ve Gantner, 2020; K\xf6ksal ve ark., 2006)."),A.pQ("    2017 y\u0131l\u0131ndan itibaren, d\xfcnyada 1 milyon ton f\u0131nd\u0131k \xfcretilmektedir. D\xfcnya f\u0131nd\u0131k \xfcretiminde ilk s\u0131ray\u0131 %65,3 ile T\xfcrkiye al\u0131rken, %13,1 ile \u0130talya, %4,3 ile Azerbaycan ve %2,9 ile Amerika Birle\u015fik Devletleri s\u0131ray\u0131 takip etmektedir. D\xfcnyada f\u0131nd\u0131k \xfcretiminde lider konumunda olan T\xfcrkiye\u2019nin elde etti\u011fi verime bak\u0131ld\u0131\u011f\u0131nda, 2017 y\u0131l\u0131 itibariyle 154 kg/da oldu\u011fu g\xf6r\xfclmektedir (FAO, 2022). T\xfcrkiye\u2019de tar\u0131m \xfcr\xfcnleri i\xe7erisinde \xf6nemli bir yeri olan f\u0131nd\u0131\u011f\u0131n, en \xe7ok ihra\xe7 edilen ve d\xf6viz getirisi sa\u011flayan tar\u0131m \xfcr\xfcn\xfc oldu\u011fu ifade edilmektedir (\xd6zt\xfcrk ve Ak\xe7ay, 2011). \xdclkemiz, kaliteli f\u0131nd\u0131k \xfcretimini sa\u011flayarak pazarda ve fiyatland\u0131rmalar\u0131n belirlenmesinde \xf6nemli role sahiptir (Secer, 2008). Bu nedenle g\xfcn\xfcm\xfczde de sahip oldu\u011fu \xf6nemli rol\xfc korumaya devam etmektedir (\u015eahinli ve \xd6z\xe7elik, 2016; Yenisu, 2017)."),A.pQ("    F\u0131nd\u0131k, i\xe7erisinde bar\u0131nd\u0131rd\u0131\u011f\u0131 ya\u011f, protein, vitamin ve minerallerden dolay\u0131 insan beslenmesinde ve sa\u011fl\u0131\u011f\u0131nda \xf6nemli bir role sahiptir (Krol ve Gantner, 2020). Yap\u0131lan bilimsel ara\u015ft\u0131rmalar f\u0131nd\u0131\u011f\u0131n; kolesterol\xfc azaltt\u0131\u011f\u0131n\u0131 ve 100 gr. t\xfcketildi\u011fi zaman insanlar\u0131n g\xfcnl\xfck protein ihtiyac\u0131n\u0131n %22\u2019sini kar\u015f\u0131lay\u0131p, enerji verdi\u011fini ortaya \xe7\u0131kartm\u0131\u015ft\u0131r (An\u0131l ve ark., 2018; ZMO, 2016)."),A.pQ("    F\u0131nd\u0131k, kaynaklar\u0131n etkili kullan\u0131lmas\u0131nda istihdam yarat\u0131rken, \xe7e\u015fitli sanayi dallar\u0131nda da hammadde, yar\u0131 mamul ve mamul (f\u0131nd\u0131k p\xfcresi/ezmesi) olarak kullan\u0131lmakta ve \xfclkemizin tar\u0131m ekonomisinin katma de\u011ferini artt\u0131rmaktad\u0131r (\xc7elikten ve ark., 2012). Ekonomik katma de\u011ferinin yan\u0131nda \u015fekerleme, \xe7ikolata, unlu mamuller, s\xfct \xfcr\xfcnleri (\xd6zdemir ve Ak\u0131nc\u0131, 2003), kozmetik ve ila\xe7 end\xfcstrisinde ham madde olarak kullan\u0131m alanlar\u0131 bulunmaktad\u0131r (\u0130slam, 2019)."),A.pQ("    F\u0131nd\u0131k \xfcretiminde piyasa standartlar\u0131n\u0131 kar\u015f\u0131lamak i\xe7in y\xfcksek kaliteli, tek tip ve dolgulu \xe7ekirdeklere sahip \xfcr\xfcnler yeti\u015ftirmek \xf6nemlidir. \xc7ekirdek b\xfcy\xfckl\xfc\u011f\xfc, \xe7ekirde\u011fin \u015fekli, \xe7ekirdek kusurlar\u0131n\u0131n varl\u0131\u011f\u0131 ve \xe7ekirdek lezzetinin yan\u0131 s\u0131ra ya\u011f i\xe7eri\u011fi ve ya\u011f \xf6zellikleri ile birlikte protein i\xe7eri\u011fi f\u0131nd\u0131k \xe7e\u015fitlerinin de\u011ferlendirmesinde \xf6nemli bir husustur. Bu \xf6zellikler \xe7evresel ve k\xfclt\xfcrel fakt\xf6rlerden etkilendikleri i\xe7in t\xfcr ve kalite aras\u0131ndaki ili\u015fki \xf6n plana \xe7\u0131kmaktad\u0131r (Krol ve Gantner, 2020; Hosseinpour ve ark., 2013). Bu fakt\xf6rler \xfcreticilerin pazar tan\u0131n\u0131rl\u0131\u011f\u0131 elde etmelerini sa\u011flamada etkilidir. \xdclkemizde bir\xe7ok mahsulde oldu\u011fu gibi f\u0131nd\u0131\u011f\u0131n \xfcretimi ve son kullan\u0131c\u0131ya ula\u015ft\u0131r\u0131lmas\u0131ndaki a\u015famalar\u0131n \xe7o\u011fu ya manuel olarak ya da teknolojinin getirdi\u011fi yeniliklerden yoksun makine ekipmanlar\u0131 ile yap\u0131lmaktad\u0131r (\xd6zdemir ve Ak\u0131nc\u0131, 2003). Bu nedenle, \xfcreticiler, t\xfcketiciler ve idari makamlar farkl\u0131 \xfcr\xfcnlerin co\u011frafi k\xf6kenini ve orijinalli\u011fini belirlemek i\xe7in yeni teknik ve y\xf6ntemlere ihtiya\xe7 duymaktad\u0131rlar (Ghisoni ve ark., 2020). \xdcr\xfcn kalitesini veya t\xfcr\xfcn\xfc belirlemede tahribats\u0131z, h\u0131zl\u0131 ve g\xfcvenilir y\xf6ntemlerin ba\u015f\u0131nda, son y\u0131llarda meyve (K\xf6kl\xfc ve ark, 2021; Sabanc\u0131 ve ark., 2015) sebze (\xd6rnek ve Kahramanl\u0131 \xd6rnek, 2021; Mulla ve ark., 2022) ve hububat (K\xf6kl\xfc ve ark., 2021; K\xf6kl\xfc ve ark., 2020) \xfcr\xfcnlerinde de s\u0131kl\u0131kla kullan\u0131lan derin \xf6\u011frenme algoritmalar\u0131 gelmektedir."),A.pQ("    Derin \xf6\u011frenme, makine \xf6\u011frenmesinin geli\u015fen ara\u015ft\u0131rma alanlar\u0131ndan birisidir (Vargas ve ark., 2017). Derin \xf6\u011frenme, genel anlamda iki fakt\xf6r\xfc g\xf6z \xf6n\xfcnde bulundurmaktad\u0131r. Bunlar; \xe7oklu katman veya a\u015famada do\u011frusal olmayan i\u015flemlerin denetimli ya da denetimsiz \xf6\u011frenmesidir (Bengio, 2009)."),A.pQ("    Derin \xf6\u011frenme algoritmalar\u0131n\u0131 Geoffrey Hinton ve Ruslan Salakhutdinas yay\u0131mlad\u0131klar\u0131 makaleyle ortaya atm\u0131\u015flard\u0131r (Hinton ve ark., 2016). Takip eden y\u0131llarda ise bir\xe7ok derin \xf6\u011frenme algoritmas\u0131 geli\u015ftirilmi\u015ftir (Goodfellow ve ark., 2016). Derin \xf6\u011frenme algoritmalar\u0131n\u0131 kullanarak veri s\u0131n\u0131fland\u0131rmas\u0131 yap\u0131labilmektedir. Bu \xe7al\u0131\u015fmada da derin \xf6\u011frenme algoritmalar\u0131yla f\u0131nd\u0131klar\u0131n s\u0131n\u0131fland\u0131r\u0131lmas\u0131 yap\u0131lm\u0131\u015ft\u0131r."),A.pQ("\n")],A.a9("p<MT*>")))
q($,"aZa","aza",()=>A.a([A.hE("    Literat\xfcr incelendi\u011finde, f\u0131nd\u0131k \xe7e\u015fitlerinin son y\u0131llarda derin \xf6\u011frenme y\xf6ntemleri, makine \xf6\u011frenmesi y\xf6ntemleri ve bilgisayar g\xf6r\xfcs\xfc yard\u0131m\u0131yla s\u0131n\u0131fland\u0131r\u0131ld\u0131\u011f\u0131 g\xf6r\xfclmektedir. Bu \xe7al\u0131\u015fmalara a\u015fa\u011f\u0131da yer verilmi\u015ftir. Literat\xfcrde bulunan \xe7al\u0131\u015fmalara ait \xf6zet bilgilere ise Tablo 1\u2019de yer verilmi\u015ftir. "),A.hE("    Say\u0131nc\u0131 ve ark. (2015), T\xfcrkiye'de yeti\u015ftirilen 17 ayr\u0131 f\u0131nd\u0131k \xe7e\u015fidinin \u015fekil \xf6zelliklerini kar\u015f\u0131la\u015ft\u0131rmay\u0131 ve g\xf6r\xfcnt\xfc i\u015fleme kullan\u0131larak \xe7e\u015fitler aras\u0131nda \u015fekil \xf6zellikleri a\xe7\u0131s\u0131ndan Eliptik Fourier analizi (EFA) ile ayr\u0131m yapmay\u0131 ama\xe7lam\u0131\u015flard\u0131r. \xc7al\u0131\u015fma sonucunda EFA ile f\u0131nd\u0131k \xe7e\u015fitleri aras\u0131nda \u015fekil \xf6zelliklerine g\xf6re olduk\xe7a ba\u015far\u0131l\u0131 sonu\xe7lar elde ettiklerini belirtmi\u015flerdir. Temel Bile\u015fen Analizi (PCA) ile f\u0131nd\u0131k t\xfcrleri aras\u0131ndaki farkl\u0131l\u0131klar \xe7\u0131kar\u0131lm\u0131\u015ft\u0131r. Ger\xe7ekle\u015ftirilen s\u0131n\u0131fland\u0131rma sonu\xe7lar\u0131nda \xe7e\u015fitler aras\u0131nda en y\xfcksek s\u0131n\u0131fland\u0131rma sonucunun da %93,9 oldu\u011funu belirtmi\u015flerdir. "),A.hE("    G\xfcven\xe7 ve ark. (2015), \xe7al\u0131\u015fmalar\u0131nda i\xe7 f\u0131nd\u0131klar\u0131n i\u015flenmesi sonucu elde edilen zarl\u0131, zars\u0131z (temiz) ve \xe7\xfcr\xfck f\u0131nd\u0131k \xf6rneklerini bilgisayarl\u0131 g\xf6r\xfc yard\u0131m\u0131yla s\u0131n\u0131fland\u0131rmay\u0131 ama\xe7lam\u0131\u015flard\u0131r. G\xf6r\xfcnt\xfcleri al\u0131nan zarl\u0131, temiz ve \xe7\xfcr\xfck i\xe7 f\u0131nd\u0131k \xf6rneklerini Destek Vekt\xf6r Makinesi-Radyal Tabanl\u0131 Fonksiyon (SVM-RBF), Bayes, Yapay Sinir A\u011flar\u0131 (ANN), Quadratic Discriminant Analysis (QDA) ve LDA ile s\u0131n\u0131fland\u0131rarak en y\xfcksek do\u011fruluk de\u011feri olan %93,57\u2019ye YSA ile ula\u015ft\u0131klar\u0131n\u0131 belirtmi\u015flerdir. "),A.hE("    Bayrakdar ve ark. (2015), \xe7al\u0131\u015fmalar\u0131nda kabuklu f\u0131nd\u0131\u011f\u0131n boyut ve \u015fekil \xf6zelliklerini kullanarak g\xf6r\xfcnt\xfc i\u015fleme teknikleri ile kabuklu f\u0131nd\u0131\u011f\u0131n cinsini ve kalitesini belirlemeyi ama\xe7lam\u0131\u015flard\u0131r. Elde edilen kabuklu f\u0131nd\u0131k g\xf6r\xfcnt\xfclerinden alan (area), jeodezik \xe7ap (geodesic diameter) ve f\u0131nd\u0131k i\xe7indeki en b\xfcy\xfck dairenin yar\u0131\xe7ap\u0131 (radius) de\u011ferlerini kullanarak ImageJ yaz\u0131l\u0131m\u0131 ile f\u0131nd\u0131k kalitesini ve t\xfcr\xfcn\xfc %84 do\u011frulukla s\u0131n\u0131fland\u0131rd\u0131klar\u0131n\u0131 belirtmi\u015flerdir. "),A.hE("    Manfredi ve ark. (2018), f\u0131nd\u0131k \xe7e\u015fitlerinin s\u0131n\u0131fland\u0131r\u0131lmas\u0131 i\xe7in \xe7ok de\u011fi\u015fkenli istatistiksel analize ba\u011fl\u0131 portatif bir Fourier Transform K\u0131z\u0131l\xf6tesi (FTIR) spektrometresi \xfczerine bir \xe7al\u0131\u015fma ger\xe7ekle\u015ftirmi\u015flerdir. S\u0131n\u0131fland\u0131rma y\xf6ntemleri olarak Temel Bile\u015fen Analizi (PCA), ard\u0131ndan LDA ve K\u0131smi En K\xfc\xe7\xfck Kareler Ayr\u0131mc\u0131l\u0131k Analizini (PLS-DA) kullanm\u0131\u015flard\u0131r. S\u0131n\u0131fland\u0131rma sonu\xe7lar\u0131nda en y\xfcksek do\u011fruluk de\u011ferine PLS-DA ile ula\u015ft\u0131klar\u0131n\u0131 belirtmi\u015flerdir. "),A.hE("    Giraudo ve ark. (2018), kusurlu f\u0131nd\u0131\u011f\u0131n tespit edilmesi i\xe7in RGB g\xf6r\xfcnt\xfc analizini kullanm\u0131\u015flard\u0131r. Kusurlu ve kusursuz f\u0131nd\u0131klardan yar\u0131s\u0131 kesilmi\u015f halde 2000 adet g\xf6r\xfcnt\xfc elde edilmi\u015ftir. G\xf6r\xfcnt\xfcler \xe7ok de\u011fi\u015fkenli s\u0131n\u0131fland\u0131rma modellerinin geli\u015ftirilmesi 2000x4900 boyutunda bir sinyal matrisine d\xf6n\xfc\u015ft\xfcr\xfclm\xfc\u015ft\xfcr. S\u0131n\u0131fland\u0131rma modeli i\xe7in PLS-DA kullanarak yakla\u015f\u0131k %97 do\u011fruluk ile kusurlu f\u0131nd\u0131klar\u0131n tespitini ger\xe7ekle\u015ftirdiklerini belirtmi\u015flerdir. "),A.hE("    Solak ve Alt\u0131n\u015f\u0131k (2018), \xe7al\u0131\u015fmalar\u0131nda g\xf6r\xfcnt\xfc i\u015fleme teknikleri ve k\xfcmeleme y\xf6ntemlerini kullanarak f\u0131nd\u0131k meyvesini k\xfc\xe7\xfck, orta ve b\xfcy\xfck olarak s\u0131n\u0131fland\u0131rmay\u0131 ama\xe7lam\u0131\u015flard\u0131r. \xc7al\u0131\u015fma sonucunda ortalama tabanl\u0131 (mean-based) ve K-means k\xfcmeleme (K-means clustering) y\xf6ntemlerinin s\u0131n\u0131fland\u0131rma sonu\xe7lar\u0131n\u0131n %90 ve \xfczerinde benzerlik g\xf6sterdi\u011fini belirtmi\u015flerdir. "),A.hE("    Dheir ve ark. (2019), \xe7al\u0131\u015fmalar\u0131nda konvol\xfcsyonel sinir a\u011f\u0131 (CNN) kullanarak 5 farkl\u0131 f\u0131nd\u0131k tipini (Peanuts, Almonds, Pecan, Hazelnut, Chestnuts) s\u0131n\u0131fland\u0131rmak i\xe7in bir model \xf6nermi\u015flerdir. \xc7al\u0131\u015fma sonucunda %98'lik bir s\u0131n\u0131fland\u0131rma do\u011frulu\u011fu elde ettiklerini belirtmi\u015flerdir. "),A.hE("    Farhadi ve ark. (2020), sesli sinyal i\u015fleme ve yapay sinir a\u011f\u0131 tekniklerini kullanarak f\u0131nd\u0131klar\u0131 b\xfcy\xfck/k\xfc\xe7\xfck, i\xe7i bo\u015f veya hasarl\u0131 olarak s\u0131n\u0131fland\u0131r\u0131lmas\u0131 i\xe7in bir y\xf6ntem \xf6nermi\u015flerdir. F\u0131nd\u0131\u011f\u0131n \xe7elik disk ile \xe7arp\u0131\u015fmas\u0131 sonucu olu\u015fan sesi \xe7elik diskin alt\u0131na yerle\u015ftirilen mikrofon ile kay\u0131t alt\u0131na alan bir sistem tasarlam\u0131\u015flard\u0131r. Elde edilen ses sinyallerinin \xf6znitelikleri sinir a\u011f\u0131na girdi olarak verilerek sonu\xe7ta %89,3 ve \xfczeri s\u0131n\u0131fland\u0131rma ba\u015far\u0131s\u0131 yakalam\u0131\u015flard\u0131r. "),A.hE("    Ko\xe7 ve ark. (2020), \xe7al\u0131\u015fmalar\u0131nda 3 farkl\u0131 f\u0131nd\u0131k \xe7e\u015fidini (Sivri, Kara, Tombul) s\u0131n\u0131fland\u0131rmak i\xe7in DL4J ve topluluk \xf6\u011frenme algoritmalar\u0131ndan faydalanm\u0131\u015flard\u0131r. \xc7al\u0131\u015fma sonucunda f\u0131nd\u0131k \xe7e\u015fitlerini Gradient Boost ve DL4J ile %95, Random Forest (RF) ile %100 do\u011frulukla s\u0131n\u0131fland\u0131rd\u0131klar\u0131n\u0131 belirtmi\u015flerdir. "),A.hE("    Kele\u015f ve Taner (2021), \xe7al\u0131\u015fmalar\u0131nda 11 farkl\u0131 f\u0131nd\u0131k \xe7e\u015fidini s\u0131n\u0131fland\u0131rmak i\xe7in \xfc\xe7 ana eksende fiziksel, mekanik ve optik \xf6zellikleri belirleyerek her eksen i\xe7in ayr\u0131 modeller olu\u015fturmu\u015flard\u0131r. ANN ve Diskriminant Analizi (DA) ile ger\xe7ekle\u015ftirilen s\u0131n\u0131fland\u0131rma sonucunda farkl\u0131 eksenlerde %89,1 ve \xfczerinde ba\u015far\u0131 elde ettiklerini belirtmi\u015flerdir. "),A.hE("    Taner ve ark. (2021), derin \xf6\u011frenme y\xf6ntemlerinden CNN kullanarak 17 farkl\u0131 f\u0131nd\u0131k \xe7e\u015fidini s\u0131n\u0131fland\u0131rmak amac\u0131yla yeni bir model \xf6nermi\u015flerdir. \xd6nerilen CNN modeli Lprttnr1 ile \xf6nceden e\u011fitilmi\u015f 4 farkl\u0131 CNN modelinin (VGG16, VGG19, ResNet50 ve InceptionV3) sonu\xe7lar\u0131n\u0131 kar\u015f\u0131la\u015ft\u0131rm\u0131\u015flard\u0131r. \xc7al\u0131\u015fma sonucunda \xf6nerilen modelin do\u011fruluk ba\u015far\u0131s\u0131n\u0131 %98,63 olarak elde ettiklerini belirtmi\u015flerdir. "),A.hE("    Ayvaz ve ark. (2022), \xe7al\u0131\u015fmalar\u0131nda T\xfcrkiye'de yeti\u015ftirilen yedi ayr\u0131 f\u0131nd\u0131k \xe7e\u015fidine ait toplam 280 f\u0131nd\u0131k \xf6rne\u011fi kullanarak f\u0131nd\u0131\u011f\u0131n NIR spektrumlar\u0131, in-shell, shelled ve white interior of split hazelnut kernels olmak \xfczere \xfc\xe7 fiziksel durumda topland\u0131\u011f\u0131n\u0131 belirtmi\u015flerdir. Toplanan spektrumlar\u0131 PLS-DA ve Lojistik Modeller kullan\u0131larak e\u011fitmi\u015flerdir. Sonu\xe7 olarak t\xfcm NIR spektrumlar\u0131na dayal\u0131 PLS-DA ve Lojistik Modellerin \xf6n i\u015fleme tekni\u011fi ile \xfc\xe7 fiziksel durumda da %100 oran\u0131nda bilinmeyen f\u0131nd\u0131k \xe7e\u015fitlerini do\u011fru bir \u015fekilde belirleyebildi\u011fini belirtmi\u015flerdir. "),A.hE("\n")],A.a9("p<MM*>")))
q($,"aZb","azb",()=>A.a([A.abc("    T\xfcrkiye f\u0131nd\u0131k \xfcretiminde ve ihracat\u0131nda lider konumda oldu\u011fu i\xe7in f\u0131nd\u0131\u011f\u0131n yeti\u015fti\u011fi alan, \xfcretimi ve verimi gibi kalitesi de ihracat gelirlerini kritik derecede etkileyen bir fakt\xf6r olarak kar\u015f\u0131m\u0131za \xe7\u0131kmaktad\u0131r. Son zamanlarda d\xfcnyada di\u011fer \xfclkelerin de f\u0131nd\u0131k \xfcretimi i\xe7in olu\u015fturdu\u011fu politikalar ve att\u0131\u011f\u0131 ad\u0131mlar T\xfcrkiye\u2019nin rekabet avantaj\u0131n\u0131 korumas\u0131 i\xe7in alandaki eksiklikleri fark ederek, \xe7\xf6z\xfcm \xfcretmesi ve yenilik\xe7i fikirlerle pazardaki konumunu g\xfc\xe7lendirmesini gerekli k\u0131lmaktad\u0131r. Bu kapsamda f\u0131nd\u0131klar\u0131n toplanmas\u0131, s\u0131n\u0131fland\u0131r\u0131lmas\u0131 ve pazarlanmas\u0131 gibi a\u015famalarda meydana gelen olumsuzluklar\u0131 minimum d\xfczeyde tutacak, m\xfcmk\xfcnse ortadan kald\u0131racak teknolojilerin geli\u015ftirilmesi olduk\xe7a \xf6nemlidir. F\u0131nd\u0131\u011f\u0131n s\u0131n\u0131fland\u0131r\u0131larak t\xfcketime sunulmas\u0131, \xe7e\u015fitli alanlarda kullan\u0131lacak f\u0131nd\u0131klar\u0131n h\u0131zl\u0131 ve pratik bir \u015fekilde saptanarak, amac\u0131na uygun kullan\u0131lmas\u0131n\u0131 sa\u011flayacak ve bu i\u015fi yapan \xfcreticilerin i\u015fini kolayla\u015ft\u0131racakt\u0131r. F\u0131nd\u0131k \xe7e\u015fitleri dikkate al\u0131narak ger\xe7ekle\u015ftirilecek s\u0131n\u0131fland\u0131rma, i\u015flemlerin do\u011fru ve h\u0131zl\u0131 yap\u0131lmas\u0131yla sonu\xe7lanarak \xfclkemizin ekonomik katma de\u011ferini artt\u0131racakt\u0131r. \xd6rne\u011fin; kozmetikte kullan\u0131lacak f\u0131nd\u0131klar\u0131n s\u0131n\u0131fland\u0131r\u0131larak do\u011frudan \xfcreticiye ula\u015ft\u0131r\u0131labilmesi hem zaman hem emek israf\u0131n\u0131n \xf6n\xfcne ge\xe7ecek kaynaklar\u0131n verimli ve etkin kullan\u0131lmas\u0131n\u0131 sa\u011flayacakt\u0131r. Ayn\u0131 \u015fekilde eczac\u0131l\u0131k alan\u0131nda da f\u0131nd\u0131klar\u0131n s\u0131n\u0131fland\u0131r\u0131lmas\u0131n\u0131n bir\xe7ok olumlu etkisi vard\u0131r. Hangi f\u0131nd\u0131\u011f\u0131n, hangi bile\u015fiklerinin ne d\xfczeyde daha etkin ve verimli oldu\u011funu saptamak ve \xfcretimde kullan\u0131labilmesine olanak sunmak gibi faydalar\u0131 bulunmaktad\u0131r."),A.abc("    \xc7al\u0131\u015fmada; f\u0131nd\u0131klar\u0131 derin \xf6\u011frenme algoritmalar\u0131yla s\u0131n\u0131fland\u0131rmak, f\u0131nd\u0131\u011f\u0131n tar\u0131m ve ekonomideki de\u011ferinin s\xfcrd\xfcr\xfclmesine katk\u0131 sunmak, ayr\u0131\u015ft\u0131rma s\u0131ras\u0131nda harcanan emek, zaman ve maliyetin minimuma d\xfc\u015f\xfcr\xfclmesini sa\u011flamak ama\xe7lanm\u0131\u015ft\u0131r."),A.abc("    Bununla birlikte f\u0131nd\u0131klar\u0131n toplanmas\u0131 ve pazarlanmas\u0131 a\u015famas\u0131nda meydana gelen olumsuzluklar\u0131n ortadan kald\u0131r\u0131lmas\u0131, \xfcreticilerin daha h\u0131zl\u0131, pratik ve etkili hareket edebilmeleri i\xe7in f\u0131nd\u0131klar\u0131n do\u011fru bir \u015fekilde s\u0131n\u0131fland\u0131r\u0131lmas\u0131yla, ithalat ve ihracat\u0131n\u0131n \xf6n\xfcn\xfc a\xe7mak hedeflenmektedir."),A.abc("\n")],A.a9("p<MO*>")))
q($,"aZc","azc",()=>A.a([A.MQ("    Tar\u0131m \xfcr\xfcnlerinin, g\xfcvenli bir \u015fekilde \xfcretilip pazarlanabilmesi amac\u0131yla tar\u0131m teknolojileriyle ilgili \xfcr\xfcn ve hizmet geli\u015ftirilmesi gerekmektedir. Son y\u0131llarda tar\u0131m teknolojilerinin geli\u015ftirilmesine y\xf6nelik \xe7al\u0131\u015fmalar yap\u0131lsa da teknolojinin h\u0131zl\u0131 ilerleyi\u015fi yeni teknolojilerin ihtiyaca adaptasyonunu \xf6nemli k\u0131lmaktad\u0131r. Bu projede tar\u0131m \xfcr\xfcnlerinin hasat sonras\u0131 g\xfcvenli, do\u011fru, hasars\u0131z, h\u0131zl\u0131 ve tarafs\u0131z de\u011ferlendirme y\xf6ntemlerinin geli\u015ftirilmesiyle; uluslararas\u0131 ve ulusal arenada tar\u0131m teknolojileri kategorisine katk\u0131 sunaca\u011f\u0131 ve s\u0131n\u0131fland\u0131rma y\xf6ntemlerinin \xe7e\u015fitli yeniliklerle ilerleme kaydedece\u011fi beklenmektedir."),A.MQ("    Normal ko\u015fullar incelendi\u011finde f\u0131nd\u0131\u011f\u0131n insan g\xfcc\xfc kullan\u0131larak ayr\u0131\u015ft\u0131r\u0131ld\u0131\u011f\u0131 ve bu durumun hem zaman hem de emek kayb\u0131na neden oldu\u011fu g\xf6r\xfclmektedir. F\u0131nd\u0131\u011f\u0131n derin \xf6\u011frenme algoritmalar\u0131yla s\u0131n\u0131fland\u0131r\u0131lmas\u0131 i\xe7in geli\u015ftirilen y\xf6ntemde ise insan g\xfcc\xfc ve zaman bile\u015fenleri en verimli ve en etkili \u015fekilde kullan\u0131lacakt\u0131r. \u0130nsan g\xfcc\xfc kullan\u0131larak yap\u0131lan s\u0131n\u0131fland\u0131rmada s\xfcre\xe7 uzun, me\u015fakkatli, yorucu, hataya a\xe7\u0131k ve ekstra maliyetlere sebep olmaktad\u0131r. Geli\u015ftirilen y\xf6ntemle birlikte y\xfcksek d\xfczeyde hassasiyetle s\u0131n\u0131fland\u0131rma yap\u0131laca\u011f\u0131ndan; hatal\u0131 \xfcr\xfcn, zaman israf\u0131, y\xfcksek maliyet ve insan g\xfcc\xfc kullan\u0131m\u0131 minimize edilecek ve s\xfcre\xe7 otomasyona d\xf6n\xfc\u015ferek kullan\u0131c\u0131 dostu hale gelecektir. Bu y\xf6ntem; do\u011fru, etkili, uygulanabilir ve alternatif y\xf6ntemler sunmas\u0131 sebebiyle benzer uygulamalardan daha \xfcst\xfcnd\xfcr."),A.MQ("    Proje kapsam\u0131nda geli\u015ftirilen y\xf6ntem kullan\u0131l\u0131p yeni \xfcr\xfcn ve cihazlar \xfcretilerek patent veya fikri/sinai m\xfclkiyet hakk\u0131 elde edilebilir. Konuyla ilgili daha \xf6nceden al\u0131nm\u0131\u015f patentlerden fark\u0131 ise; \xe7e\u015fitli f\u0131nd\u0131k \xe7e\u015fitlerini h\u0131zl\u0131 ve az maliyetle ayr\u0131\u015ft\u0131rma \xf6zelliklerinin olmas\u0131d\u0131r."),A.MQ("    Bu proje, ba\u015fta tar\u0131m olmak \xfczere bir\xe7ok alanda yapay zeka uygulamalar\u0131n\u0131n geli\u015ftirilmesine katk\u0131 sunaca\u011f\u0131 i\xe7in multidisipliner \xe7al\u0131\u015fma ortam\u0131n\u0131n olu\u015fturulmas\u0131na vesile olacakt\u0131r. Projenin tar\u0131m, g\u0131da, ila\xe7, kozmetik gibi bir\xe7ok sekt\xf6r\xfcn teknolojik alanlar\u0131yla i\u015f birli\u011fi i\xe7erisinde olmas\u0131 beklenmektedir."),A.MQ("\n")],A.a9("p<MR*>")))
q($,"aZ9","az9",()=>A.a([A.aBI("    Bu \xe7al\u0131\u015fmadan esinlenilerek, f\u0131nd\u0131klar\u0131n t\xfcrler aras\u0131 ay\u0131rma i\u015flemlerini kolayl\u0131kla sa\u011flayabilecek mobil uygulama yaz\u0131l\u0131mlar\u0131 geli\u015ftirilebilir. Bu sayede bireyler kolayl\u0131kla bilgi sahibi olabilecek ve kullan\u0131m kolayl\u0131\u011f\u0131 sundu\u011fu i\xe7in daha \xe7ok tercih edilebilecektir. Dolay\u0131s\u0131yla gelecekte yap\u0131lacak \xe7al\u0131\u015fmalarda mobil uygulaman\u0131n geli\u015ftirilmesi \xf6nerilmektedir. Bunun yan\u0131nda ayn\u0131 bah\xe7ede yeti\u015fen farkl\u0131 t\xfcr f\u0131nd\u0131klar\u0131n ger\xe7ek zamanl\u0131 olarak ayr\u0131\u015ft\u0131r\u0131lmas\u0131n\u0131 ve kategorize edilmesini sa\u011flayacak yapay zeka robotlar\u0131yla, hasat vaktinde hem insan g\xfcc\xfcnden hem zamandan maksimum fayda sa\u011flanmas\u0131 i\xe7in \xfcr\xfcn ve cihazlar \xfcretilebilir. Makine, cihaz veya \xfcr\xfcnler geli\u015ftirildi\u011fi takdirde patent ve fikri/sinai m\xfclkiyet hakk\u0131 talebinde de bulunabilecektir."),A.aBI("    Yap\u0131lacak bilimsel ara\u015ft\u0131rmalarda veri setindeki g\xf6r\xfcnt\xfc say\u0131s\u0131n\u0131n ve t\xfcr \xe7e\u015fitlerinin artt\u0131r\u0131larak uygulan\u0131p, yeni y\xf6ntemlerin geli\u015ftirilmesine katk\u0131 sunmas\u0131 \xf6nerilmektedir.\n\n\n")],A.a9("p<Mt*>")))
